async function runProducer(ordre){
    
    try
    {
         
        const producer = kafka.producer();
      //  console.log("Connecting.....")
        await producer.connect()
     //   console.log("Connected!")
        //A-M 0 , N-Z 1 
      //  const partition = msg[0] < "N" ? 0 : 1;
        const result =  await producer.send({
            "topic": "carte-grise-consumer-topic",
            "messages": [
                {
                    "value": JSON.stringify(ordre),
                    "partition": 0
                }
            ]
        }).then(result => {
             
            
            if(result[0]['errorCode']== 0){

                console.log('');
                console.log('');
              //  console.log('sent data = ' + JSON.stringify(ordre));
              
              console.log("data was sent : 'numeroOrdreRecette'"+ ordre['numeroOrdreRecette']);

            }
            
          })
          .catch(err => {
            console.log('error = '+err);
            
          });

        
        await producer.disconnect();

        
    }
    catch(ex)
    {
        console.error(`Something bad happened ${ex}`)
    }
   

}



  